import React from 'react';
import {jobs} from './data';
import Card from './Card';

const Cardlist = ({click}) => {
    return(
        <div className='cardList'>
        {
           jobs.map((job,i) => {
               const {image,company,date,position,details,skills,sidebar} = job;
               return <Card 
                            clicked={click}
                            key={i}
                            image={image} 
                            company={company} 
                            date={date} 
                            position={position} 
                            details={details} 
                            sidebar={sidebar}
                            skills={skills}/>

           }) 

        }
        </div>
    )
}

export default Cardlist;
